import React from "react";
import useForm from "../hooks/useForm";
import axios from "axios";
import CheckLogin from "./checkLogin";
import { useNavigate } from "react-router-dom"
import { Login_url } from "../constants/urls";

export default function FormLogin() {
	const navigate = useNavigate();

  CheckLogin();

  const [form, onChange, clear] = useForm({email:'', password: ''})

  const submitForm = (e) => {
    e.preventDefault()
  }

  const getIn = () => {
    const body = {
      email: form.email,
      password: form.password
    }
    axios.post(Login_url, body)
    .then((res) => {
      localStorage.setItem('tokenEddit');
      navigate('posts')
      clear();
    })
    .catch

  }

  return (
    <div>
      <form onSubmit={submitForm}>
        <input required type={'email'} value={form.email} onChange={onChange} placeholder="Digite seu email"></input>
        <input required type={'password'} value={form.password} onChange={onChange} placeholder="Digite sua senha"></input>
      </form>
      <button onClick={getIn}>Fazer Login</button>
    </div>
  );
}
